import React from 'react';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as IoIcons from 'react-icons/io';

export const HamburgerData = [
  {
    title: 'Women',
    path: '/women',
    cName: 'nav-text'
  },
  {
    title: 'Men',
    path: '/men',
    cName: 'nav-text'
  },
  {
    title: 'Jewellery',
    path: '/jewellery',
    cName: 'nav-text'
  },
  {
    title: 'Electronics',
    path: '/electronics',
    cName: 'nav-text'
  }
];
